import ShelfChanger from "./ShelfChanger";

const Books = ({ book }) => {
  const { title, author, url } = book;

  return (
    <li>
      <div className="book">
        <div className="book-top">
          <div
            className="book-cover"
            style={{
              width: 128,
              height: 193,
              backgroundImage:
                `url(${url})`,
            }}
          ></div>
          <ShelfChanger />
        </div>
        <div className="book-title">{title}</div>
        <div className="book-authors">{author}</div>
      </div>
    </li>
  )
}

export default Books
